import './App.css';

import Nav from './components/Nav.js';
import Main from './components/Main.js';

function App() {
  return (
    <Context.Provider value={{userData, setUserData}}>
      <div className="app">
          <Nav />
          <Main />
      </div>
    </Context.Provider>
  );
}

export default App;
